import 'bootstrap/dist/css/bootstrap.min.css';
import Pages from "./components/Pages";
import Profiletab from "./components/Profiletab";

const App = () => {
  return (
    <div className="main">
      <Profiletab />
      <Navbar />
      <Pages />
    </div>
  );
}

export default App;
